import React from 'react';
import { Image, Tabs } from 'antd';
import StyledTitle from './Titles';
import StyledList from './Lists';

const { TabPane } = Tabs;
const shortid = require('shortid');

const frontendList = [
  {
    id: shortid,
    title: 'Travelary',
    img: '',
  },
];

const publishList = [
  {
    id: shortid,
    title: 'Publish Soft Admin',
    img: '',
  },
  {
    id: shortid,
    title: 'Publish Soft Admin',
    img: '',
  },
];

const PortpolioList = () => {
  const legnth = frontendList.length;
  const legnth2 = publishList.length;
  return (
    <div>
      <StyledTitle>
        <span>Portpolio List ✨</span>
      </StyledTitle>
      <Tabs defaultActiveKey='1' centered>
        <TabPane tab={`Front-end(${legnth})`} key='1'>
          <StyledList>
            {frontendList.map((list) => {
              return (
                <li key={list.id}>
                  <Image />
                  <p>{list.title}</p>
                </li>
              );
            })}
          </StyledList>
        </TabPane>
        <TabPane tab={`Publishing(${legnth2})`} key='2'>
          <ul>
            {publishList.map((list) => {
              return (
                <StyledList key={list.id}>
                  <p>{list.title}</p>
                </StyledList>
              );
            })}
          </ul>
        </TabPane>
      </Tabs>
    </div>
  );
};

export default PortpolioList;
